        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](165, "\u05D0\u05DC \u05EA\u05E6\u05DE\u05D9\u05D3\u05D5 \u05D0\u05EA \u05D4\u05DE\u05E7\u05E8\u05E8 \u05DC\u05E7\u05D9\u05E8");
